While creating the SIP user, the system displays the message 'You can only create 3 agents. Thank you.' This message appears because the user has not assigned a DID number. When a DID number has not been assigned, the message should be 'This user has not assigned a DID number.'

{
"error": true,
"message": "validation error",
"data": {
"didId": [
"You can only create 3 agents.Thank you"
]
}
}

